total_change = int(input())dollar = 100quarter = 25dime = 10nickel = 5penny = 1if total_change == 0:    print('No change')elif total_change >= 0:    #dollars    if total_change >= 100:        dollar_change = (total_change - (total_change % dollar)) / dollar        dollar_change = int(dollar_change)        total_change = total_change - dollar_change * 100        if dollar_change <= 1:            print(dollar_change, 'Dollar')        else:            print(dollar_change, 'Dollars')    #quarters    if total_change >= 25:        quarter_change = (total_change - (total_change % quarter)) / quarter        quarter_change = int(quarter_change)        total_change = total_change - quarter_change * 25        if quarter_change <= 1:            print(quarter_change, 'Quarter')        else:            print(quarter_change, 'Quarters')    #dimes    if total_change >= 10:        dime_change = (total_change - (total_change % dime)) / dime        dime_change = int(dime_change)        total_change = total_change - dime_change * 10        if dime_change <= 1:            print(dime_change, 'Dime')        else:            print(dime_change, 'Dimes')    #nickles    if total_change >= 5:        nickel_change = (total_change - (total_change % nickel)) / nickel        nickel_change = int(nickel_change)        total_change = total_change - nickel_change * 5        if nickel_change <= 1:            print(nickel_change, 'Nickel')        else:            print(nickel_change, 'Nickels')    #pennies    if total_change >= 1:        '''penny_change = (total_change - (total_change % penny)) / penny        penny_change = int(penny_change)        total_change = total_change - penny_change * 1'''        penny_change = total_change        if penny_change <= 1:            print(penny_change, 'Penny')        else:            print(penny_change, 'Pennies')